import {Jump} from '../components/Jump';
import Navbar2 from '../components/Navbar-2';


function Index() {
    return (
        <div >
            <div>
                <div classNamee = "h-screen container">
                    {/* <Navbar/> */}
                    <Navbar2/>
                    <HeroIntro />
                </div>
                <div className = "mx-auto m-width-full">
                    <div >
                        <Collections />
                    </div>

                </div>
            </div>
            <Jump/>

        </div>
    )
}

export default Index
